        {
            s.Write(mHubAddress);
            s.Write(mUpdateRate);
            s.Write(mSftregByte);
            s.Write(mExtrabyte);
        }

        internal override void DeserializeBody(BinaryReader s)
        {
            this.mHubAddress = s.ReadByte();
            this.mUpdateRate = s.ReadByte();
            this.mSftregByte = s.ReadByte();
            this.mExtrabyte = s.ReadByte();
        }

